    colors: {
        mainBlue: 'rgb(84, 185, 209)',
        main60: 'rgba(84, 185, 209, 0.6)',
        black: '#3F4B3B',
        yellow: '#EFDC05',
        white: '#ffffff',
        white20: 'rgba(255, 255, 255, 0.2)',
        white50: 'rgba(255, 255, 255, 0.5)',
        grey: '#a4b0be',
        plum: '#efb8e4',
        red: '#E53A40',
        green: '#3ae374',
